import React from 'react';

class DetailsForm extends React.Component {
  constructor(props) {
    super(props);

    this.handleChange = props.changeHandler;
    this.getState = props.stateProvider;
  }

  render() {
    return (
      <form onSubmit={this.handleSubmit}>
        <label>
          Client ID:
          <input type="text" onChange={this.handleChange} />
        </label>

        <br/>

        <label>
          Client Secret:
          <input type="text" onChange={this.handleChange} />
        </label>
        <br/>

        <label>
          Auth endpoint:
          <input type="text" onChange={this.handleChange} />
        </label>
        <br/>

        <label>
          Token endpoint:
          <input type="text" onChange={this.handleChange} />
        </label>
      </form>
    );
  }
}

export default DetailsForm;
